INSERT INTO `item_tbl` VALUES (1,'NEW','2025-02-01 10:38:30','A cute plush','Higekiri Wanpaku',64.99,0,'NORMAL','AVAILABLE','2025-03-03 17:37:03',119,1,'APPROVED'),(2,'NEW','2025-02-01 10:39:37','A cute nendo','Higekiri Nendoroid',100.99,1,'NORMAL','AVAILABLE','2025-02-06 17:08:25',126,1,'APPROVED'),(3,'NEW','2025-02-02 17:25:00','An album based on Burmese Alchemy by Hirasawa Susumu','Philosphers Propeller',100,0,'AUCTION','AVAILABLE','2025-03-05 14:46:47',103,1,'APPROVED'),(13,'OLD','2025-02-05 18:07:02','The Daughter of Evil: Clôture of Yellow is the first The Daughter of Evil light novel, released on August 10, 2010. The novel was written by Akuno-P and primarily illustrated by Ichika. It covers the events of both The Daughter of Evil and The Servant of Evil, elaborating on Allen\'s service to Princess Riliane and Germaine\'s motivations for vengeance and revolution.','Daughter of Evil',23,1,'AUCTION','AVAILABLE','2025-02-05 18:07:02',102,1,'APPROVED'),(15,'OLD','2025-02-05 18:22:13','The Daughter of Evil: Wiegenlied of Green is the second The Daughter of Evil light novel, released on February 25, 2011. The novel was written by Akuno-P and illustrated by Suzunosuke and Ichika. It covers the events of Regret Message, The Daughter of White, and Tree Maiden ~Millennium Wiegenlied~, elaborating on the relationship between Clarith and Michaela and Princess Riliane\'s connection to the Seven Deadly Sins.','Daughter of Evil: Wiegenlied of Green',24,0,'AUCTION','AVAILABLE','2025-03-05 16:51:12',102,1,'APPROVED'),(22,'NEW','2025-02-09 13:41:54','The Plated White Lamp is a sleek and elegant addition to any bedroom decor, offering a perfect balance of style and functionality. Featuring a minimalist white metal base with a plated finish, it complements modern and contemporary interiors. The soft, warm glow from the lamp creates a calming atmosphere, ideal for relaxing evenings or setting the mood for reading. Its simple yet sophisticated design makes it versatile enough to blend with various decor styles, while its compact size ensures it fits seamlessly on bedside tables or nightstands.','Plated White Lamp',12,5,'NORMAL','AVAILABLE','2025-02-09 20:25:09',62,4,'APPROVED'),(23,'NEW','2025-02-09 13:45:20','The Cloud-shaped Pink Tulip Lamp is a charming and whimsical addition to any bedroom, adding a soft, dreamy ambiance. Featuring a unique cloud design with a delicate pink tulip accent, this lamp creates a serene and cozy atmosphere. The gentle glow of the lamp provides just the right amount of light for relaxation, reading, or creating a peaceful environment. Its playful yet elegant design makes it an eye-catching piece, perfect for enhancing a romantic or calming bedroom setting. A perfect fusion of functionality and style, it brings a touch of nature-inspired beauty to your space.','Cloud-shaped Pink Tulip Lamp',14,6,'NORMAL','AVAILABLE','2025-02-09 20:25:09',62,4,'APPROVED'),(25,'NEW','2025-02-09 13:50:13','The 3D Digital Clock is a modern and innovative bedroom decoration that combines functionality with a sleek, futuristic design. Featuring a clear, easy-to-read LED display, it shows time in a bold 3D format, adding a unique touch to your space. The clock can be adjusted to show the time in different brightness levels, allowing you to customize it according to your preference. Its minimalist design complements contemporary interiors, making it a perfect addition to any modern bedroom. With its striking visual appeal and practical features, this clock enhances your decor while providing accurate timekeeping.','3D Digital Clock',10,7,'NORMAL','AVAILABLE','2025-02-09 20:25:09',62,4,'APPROVED'),(26,'NEW','2025-02-09 13:50:55','The White Circle-shaped Fluffy Rug is a luxurious and soft addition to any bedroom, offering both comfort and style. Crafted with high-quality, plush fibers, this rug provides a cozy, cloud-like feel underfoot, making it perfect for adding warmth and texture to your space. Its circular design and pure white color create a serene, minimalist aesthetic that complements various interior styles. Ideal for placing beside the bed or in a cozy corner, this fluffy rug enhances the overall ambiance of your bedroom, creating a welcoming and tranquil atmosphere.','White Circle-shaped Fluffy Rug',20,1,'NORMAL','AVAILABLE','2025-02-09 20:25:09',55,4,'APPROVED'),(27,'NEW','2025-02-09 13:53:46','This Pink Flower Hair Claw is a delicate and stylish accessory, perfect for adding a touch of elegance to any hairstyle. Crafted from durable yet lightweight material, it features a beautiful floral design in soft pink hues, bringing a feminine and romantic charm. The sturdy claw grip ensures a secure hold, making it ideal for both casual and formal looks. Whether for everyday wear or special occasions, this hair claw effortlessly enhances any hairstyle with a graceful and sophisticated touch.','Pink Flower Hair Claw',5,10,'NORMAL','AVAILABLE','2025-02-09 20:25:09',96,4,'APPROVED'),(28,'NEW','2025-02-09 13:55:24','MIELLE Rosemary Mint Scalp & Hair Strengthening Oil is a nutrient-rich formula designed to nourish the scalp and promote stronger, healthier hair. Infused with rosemary, mint, and biotin, it stimulates hair growth while reducing breakage and split ends. The lightweight oil deeply penetrates the scalp, providing intense hydration and a refreshing, invigorating sensation. Suitable for all hair types, it can be used for scalp treatments, split-end care, or as a daily moisturizer. Perfect for those seeking thicker, shinier hair, this oil enhances overall hair health with natural, strengthening ingredients.','MIELLE Rosemary Mint Scalp & Hair Strengthening Oil',84,2,'NORMAL','AVAILABLE','2025-03-03 17:35:20',98,4,'APPROVED'),(29,'NEW','2025-02-09 13:56:35','DOVE Nourishing Moisture Shampoo and Conditioner provide deep hydration and nourishment for soft, healthy-looking hair. Infused with Pro-Moisture Complex, the shampoo gently cleanses while replenishing essential moisture, leaving hair smooth and manageable. The conditioner deeply conditions, restoring softness and shine without weighing hair down. Perfect for daily use, this duo works together to repair dryness and improve hair resilience. Suitable for all hair types, it enhances hydration, leaving hair feeling silky, refreshed, and beautifully nourished.','DOVE Nourishing Moisture Shampoo and Conditioner',23,12,'NORMAL','AVAILABLE','2025-02-09 20:25:09',95,4,'APPROVED'),(30,'NEW','2025-02-09 13:57:31','The Jelly Hair Claw is a trendy and lightweight accessory designed for a secure yet comfortable hold. Made from high-quality, flexible jelly-like material, it offers a soft, smooth texture that adds a playful and modern touch to any hairstyle. Its strong grip ensures it stays in place, making it perfect for everyday styling or effortless updos. Available in various vibrant and pastel shades, this hair claw is both practical and stylish, adding a chic accent to any look','Jelly Hair Claw',6,11,'NORMAL','AVAILABLE','2025-02-09 20:25:09',96,4,'APPROVED'),(31,'NEW','2025-02-09 13:58:20','The Royal Blue Oversized Satin Scrunchie is a luxurious hair accessory that adds elegance and volume to any hairstyle. Made from high-quality satin, it features a smooth, glossy finish that enhances its rich royal blue color. Its oversized design provides a statement look while being gentle on the hair, reducing breakage and frizz. The soft satin texture helps prevent creases, making it perfect for all-day wear or overnight styling. Ideal for all hair types, this scrunchie ensures a secure yet comfortable hold, adding both beauty and protection to your hair routine.','Royal Blue Oversized Satin Scrunchie',4,20,'NORMAL','AVAILABLE','2025-02-09 20:25:09',96,4,'APPROVED'),(32,'NEW','2025-02-09 14:06:59','The Rom&nd Korean Eyeshadow Pink Palette offers a stunning selection of soft, romantic shades perfect for everyday elegance or glamorous looks. Featuring a mix of matte, shimmer, and glitter finishes, each finely milled shade blends effortlessly for smooth, long-lasting wear. The highly pigmented formula ensures vibrant color payoff while remaining lightweight and comfortable on the lids. Housed in a sleek, travel-friendly compact, this palette is ideal for creating versatile eye makeup styles, from subtle pink hues to dazzling, multidimensional effects.','Rom&nd Eyeshadow Palette',88,0,'NORMAL','AVAILABLE','2025-02-09 20:25:09',92,5,'APPROVED'),(33,'NEW','2025-02-09 14:08:28','JM Solution H9 Hyaluronic Ampoule Cleansing Water is a gentle yet effective makeup remover and cleanser infused with nine types of hyaluronic acid for deep hydration. This lightweight formula effortlessly dissolves makeup, dirt, and impurities while maintaining the skin’s moisture balance. Enriched with nourishing ingredients, it soothes and refreshes the skin without causing irritation or dryness. Its non-greasy, residue-free texture makes it ideal for all skin types, leaving the skin feeling soft, clean, and hydrated after every use. Perfect for a quick and refreshing cleanse, even on sensitive skin.','JM Solution H9 Hyaluronic Ampoule Cleansing Water',56,2,'NORMAL','AVAILABLE','2025-02-09 20:25:09',89,5,'APPROVED'),(34,'NEW','2025-02-09 14:09:54','Vaseline Rosy Tinted Lip Balm provides deep hydration while adding a natural rosy tint for soft, healthy-looking lips. Infused with Vaseline’s signature petroleum jelly, it locks in moisture to heal and protect dry or chapped lips. The lightweight formula glides on smoothly, giving a subtle pink hue with a healthy, dewy finish. Perfect for daily wear, it enhances the lips\' natural color while keeping them nourished and smooth. Ideal for all seasons, this lip balm ensures long-lasting comfort and a naturally radiant look.','Vaseline Rosy Tinted Lip Balm',17,0,'NORMAL','AVAILABLE','2025-02-09 20:25:09',94,5,'APPROVED'),(35,'NEW','2025-02-09 14:10:48','The Ordinary Peeling Solution is a powerful, exfoliating treatment designed to refine skin texture and reveal a brig